webpackJsonp([0xae7d3318238a],{298:function(e,a){e.exports={data:{markdownRemark:{html:'<p>I like to design and code simple, usable products and design systems.</p>\n<p>Currently I work as a designer at <a href="https://deliveroo.co.uk">Deliveroo\'s</a> UI Infrastructure team. I work on our internal design systems and tooling to help designers and engineers collaborate more easily and be more productive.</p>\n<p>Previously I headed up design at Lyst for almost 5 years, growing the company from 5 to 120 people.</p>\n<p>I also recently started <a href="https:">a slack group</a> for product designers in London to talk shop.</p>\n<p><a href="mailto:mathiasvagni@gmail.com">Get in touch.</a></p>',frontmatter:{title:"Homepage",date:null}}},pathContext:{path:"/pages/bio/"}}}});
